  false,\n\t\"url\": null,\n\t\"notes\": \"The North Dakota Game and Fish Department
  (NDGF) interactive maps services provide the user with a vast amount of data and
  functionality all available through the web browser. These map services offer a
  rich user experience with additional functionality, tools and widgets. Users can
  interact with the map features and customize the map they desire. Some of these
  maps services are optimized for mobile devices. With responsive design these applications
  will format according to the device form (desktop, tablet, handheld).\",\n\t\"license_title\":
